import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav className="navbar navbar-expand-lg sticky-top shadow px-3">
      <div className="container-fluid d-flex justify-content-between align-items-center">
        {/* Left Side - Logo & Brand Name */}
        <Link
          className="navbar-brand fw-bold fs-4"
          to="/"
          style={{
            marginLeft: "10px",
            background: "linear-gradient(90deg, #4CAF50, #1E88E5)",
            WebkitBackgroundClip: "text",
            WebkitTextFillColor: "transparent",
            fontWeight: "bold",
            fontSize: "26px",
          }}
        >
          üçè NutriFit-Hub
        </Link>

        {/* Navbar Toggle Button for Mobile */}
        <button
          className="navbar-toggler border-0"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarNav"
          style={{ marginRight: "10px" }}
        >
          <span className="navbar-toggler-icon"></span>
        </button>

        {/* Navigation Links */}
        <div className="collapse navbar-collapse justify-content-end" id="navbarNav">
          <ul className="navbar-nav">
            <li className="nav-item">
              <Link
                className="nav-link fw-semibold fs-5 me-3"
                to="/"
                style={{ color: "#333", transition: "color 0.3s ease-in-out" }}
                onMouseEnter={(e) => (e.target.style.color = "#4CAF50")}
                onMouseLeave={(e) => (e.target.style.color = "#333")}
              >
                Home
              </Link>
            </li>

            <li className="nav-item">
              <Link
                className="nav-link fw-semibold fs-5 me-3"
                to="/dashboard"
                style={{ color: "#333", transition: "color 0.3s ease-in-out" }}
                onMouseEnter={(e) => (e.target.style.color = "#1E88E5")}
                onMouseLeave={(e) => (e.target.style.color = "#333")}
              >
                Dashboard
              </Link>
            </li>

            <li className="nav-item">
              <Link
                className="nav-link fw-semibold fs-5 me-3"
                to="/about"
                style={{ color: "#333", transition: "color 0.3s ease-in-out" }}
                onMouseEnter={(e) => (e.target.style.color = "#E91E63")}
                onMouseLeave={(e) => (e.target.style.color = "#333")}
              >
                About
              </Link>
            </li>

            <li className="nav-item">
              <Link
                className="nav-link fw-semibold fs-5 me-3"
                to="/signin"
                style={{ color: "#333", transition: "color 0.3s ease-in-out" }}
                onMouseEnter={(e) => (e.target.style.color = "#F57C00")}
                onMouseLeave={(e) => (e.target.style.color = "#333")}
              >
                Sign In
              </Link>
            </li>

            <li className="nav-item">
              <Link
                className="nav-link fw-semibold fs-5 me-3"
                to="/register"
                style={{ color: "#333", transition: "color 0.3s ease-in-out" }}
                onMouseEnter={(e) => (e.target.style.color = "#8E24AA")}
                onMouseLeave={(e) => (e.target.style.color = "#333")}
              >
                Register
              </Link>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
